import "./StartScreem.css/";
import "."

const StartScreem = () => {
  return (
    <div>
        <h1>Secret World</h1>
        <p>Clique no botão abaixo para começar a jogar </p>
        <button>Start</button>
    </div>
  )
}

export default StartScreem
